import React, {Component} from "react";

class Timer extends Component {
    constructor(props) {
        super(props);
        this.state = {
            hours:'00',
            minutes:'00',
            seconds:'00'
        }
    }
    
    render () {
        return (
            <div className = "timer-editor">
                <input placeholder={this.state.hours}></input>
                <input placeholder={this.state.hours}></input>
                <input placeholder={this.state.hours}></input>

            </div>
        );
    }
}

export default Timer;
